network-registration(icp-item : class gsi-interface )
gsi-var: class gsi-opc-item; 
handle: integer;
gsi-var-int: symbol; 

begin  
    
   if icp-item  has a name then
    for gsi-var = each gsi-opc-item do
            if the gsi-interface-name of gsi-var exists and  the  gsi-interface-name of gsi-var /= the symbol none then 
                    begin 
                           gsi-var-int = the gsi-interface-name of gsi-var;
                           if gsi-var-int   = the name of icp-item then 
                           handle = call g2-register-on-network (gsi-var, icp-item);
                   end;             
   end;
end

item-registration(l: class item )  
handle: integer;
name-int: symbol;

begin  
      if the gsi-interface-name of l exists and  the  gsi-interface-name of l /= the symbol none then 
             begin 
                
                name-int = the gsi-interface-name of l; 
                if there exists a gsi-interface gs named by name-int and the gsi-interface-status of gs =2 then 
                    handle = call g2-register-on-network (l, gs);
            end;
           
end

update-interface-object(oio : class gsi-opc-interface)
    stat : symbol ;
begin
    stat = call rpc-opc-report-connection-status () across oio ;
    conclude that the connection-status of oio = stat
end

update-opc-interface-icon ( IO: class gsi-opc-interface )

begin

   { The following case statement references the gsi-connection-status of a gsi-opc-interface object. With the exception of connection-status, the connection indicated below is the connection between G2 and the database bridge. This connection does not refer to the connection between the bridge and OPC server. ***** In all cases (except timed-out), the connection-status attribute of the interface object is set to DISCONNECTED as a break in the connection between G2 and the bridge automatically results in a break in the connection between the bridge and server. }

   if the connection-status of IO exists and the roof of the item-color-pattern of IO exists and the server of the item-color-pattern of IO exists and the windows of the item-color-pattern of IO exists and the side of the item-color-pattern of IO exists and the g2-bridge-connect of the item-color-pattern of IO exists then

   case ( the connection-status of IO ) of
  
      BRIDGE: begin            { Failed to connect to server } 
            if server-colors is TRUE then 
            begin 
               change the g2-bridge-connect icon-color of IO to the success-color of server-colors; 
               change the server icon-color of IO to the not-connected-body-color of server-colors;
               change the windows icon-color of IO to the not-connected-top-color of server-colors;
               change the roof icon-color of IO to the not-connected-roof-color of server-colors ;
               change the side icon-color of IO to the not-connected-side-color of server-colors
            end
         end ;
      SERVER: begin             { connected to server, did not add group }
            if server-colors is TRUE then begin
               change the g2-bridge-connect icon-color of IO to the success-color of server-colors;
               change the server icon-color of IO to the not-connected-body-color of server-colors ;
               change the windows icon-color of IO to the connected-top-color of server-colors ;   
               change the roof icon-color of IO to the connected-roof-color of server-colors ;
               change the side icon-color of IO to the not-connected-side-color of server-colors
            end ;
           end;
      GROUP: begin             { everything connected }
            if server-colors is TRUE then begin
               change the g2-bridge-connect icon-color of IO to the success-color of server-colors;
               change the server icon-color of IO to the connected-body-color of server-colors ;
               change the windows icon-color of IO to the connected-top-color of server-colors ;
               change the roof icon-color of IO to the connected-roof-color of server-colors ;
               change the side icon-color of IO to the connected-side-color of server-colors
                end ;
            end;
      otherwise: begin   { should not be possible }
         if server-colors is TRUE then begin
            change the g2-bridge-connect icon-color of IO to the warning-color of server-colors;
            change the server icon-color of IO to the not-connected-body-color of server-colors ;
            change the windows icon-color of IO to the not-connected-top-color of server-colors ; 
           change the roof icon-color of IO to the not-connected-roof-color of server-colors ;
           change the side icon-color of IO to the not-connected-side-color of server-colors
             end ;
        end
    end
end
